  //   return (setSearchRes(searchResults))
  // }

  return (
    <div className="Navigator">
      <div className = " navContain">
      <Link to='/App'>Home
        <div className="buttonContainer">
            <button className = "phoneHome">
              Home
                <div type="button" className = "innerCircle"/>
                <div type="button" className = "inCircle"/>
            </button>
        </div>
      </Link>
       <Search  className = "Search"/>
       {/* <Search handleSearch = {handleSearch} className = "Search"/> */}
      </div>  
      <Link to='/AddNew'>
        <button className= "ADDPOKE" aria-label = "+ ADD POKEMON">
        + ADD NEW POKEMON
        </button>
      </Link>
        {/* <AddNew /> */}
    </div>

  );
}

export default Navigator;
